import React from "react";
import { useState } from "react";
import "../css/Slider.css"
class Header extends React.Component {
    constructor()
    {
        super();
        this.state = {value1 : "0", value2 : "0", value3 : "40%", maxValue : "100000", minValue : "200000"}
    }
    test()
    {
        alert("abc");
    }
    render() {
      return (
        <div className="">
            <div className="wrapper">
                <input className="firstDiv" style={{width : this.state.value3}}  value={this.state.value1} name="range" type="range" id="customRange1" min={0} max={100} step={10} onChange={e => this.setState({value1 : e.target.value})} />
                <input className="secondDiv" style={{width : "100%", color : "red"}} value={this.state.value2} name="range" type="range" id="customRange1" min={0} max={100} step={10} onChange={e => this.setState({value2 : e.target.value})} />
            </div>
            <br></br>
            <div className="float-left">Gi√°</div>
            <div className="float-right">Abc</div>
            <div id="multi-ranges-tooltips" data-tooltip="true"></div>
            
            <div>{this.state.value1}</div>
            <button onclick="activateLasers()" type="button">
            Activate Lasers
            </button>
        </div>
      );
    }
  }
  
  export default Header;
